insert  into `course`(`id`,`public_no`,`title`,`expert_openid`,`start_date`,`end_date`,`set_num`,`sign_num`,`zan_num`,`profile`,`price`,`create_time`,`delete_state`,`create_user`,`filed1`,`filed2`,`filed3`,`filed4`,`filed5`) values ('1739bdf572f646d69548c76ec916eb32','gh_8e5eb3255148','严重感染与感染性休克血流动力学监测','8228cff1972a43a0a543d5419e78e9b5','2015-09-3 09:00',NULL,100,3,2,'严重感染（severe sepsis）及其相关的感染性休克(septic shock)和多脏器功能障碍综合症(multiple organ dysfunction syndrome MODS)是当前重症加强治疗病房(ICU)内主要的死亡原因，也是当代重症医学面临的主要焦点及难点。',NULL,'2015-07-29 14:41:36',1,NULL,NULL,'zb_img_2015072902413626197.jpg',NULL,NULL,NULL),('17f4fedec7d04be185c47beb5171c8fc','gh_8e5eb3255148','重症病人补液','2e66384eaabe490ebefe578878d1a395','2015-08-21 09:00',NULL,130,25,15,'1、危重病人何时需要补液治疗\r\n2、何时开始补液治疗\r\n3、补液时的检测方法\r\n4、何时停止补液治疗',NULL,'2015-07-30 14:42:24',1,NULL,NULL,'zb_img_2015073002422436824.jpg',NULL,NULL,NULL),('4547bff92361475ebda1407738e6e47b','gh_8e5eb3255148','心搏呼吸骤停原因','1e861a0042284dfeb7305fab5df879cc','2015-08-30 09:00',NULL,150,0,0,'心搏呼吸骤停原因：\r\n\r\n（1）冠心病是其最常见原因，其中70死于医院外。冠心病猝死的10%死于发病后15min；30%死于发病后15分钟至2小时。\r\n\r\n（2）突然的意外事件：如电击伤、溺水、自缢、严重创伤、窒息等。',NULL,'2015-07-28 14:43:02',1,NULL,NULL,'zb_img_20150728024302587694.jpg',NULL,NULL,NULL),('57213234518443f4b3edaff6914c6236','gh_8e5eb3255148','外科重症监测及治疗','e4149b6a62734b749582b37948a3af3b','2015-08-21 09:00',NULL,150,0,0,'ICU区别于其他病房具有以下特点：\r\n1、收治重要脏器功能不全的危重病人。\r\n2、可对病人进行连续、动态全面监测，以达到早期诊断及时处理。\r\n3、据有最先进的诊治手段。\r\n4、ICU专职医师与专科医师协同诊治。',NULL,'2015-07-24 11:45:27',1,NULL,NULL,'zb_img_20150724114527729415.jpg',NULL,NULL,NULL),('79e9513a86514c17ace5365877d2b399','gh_8e5eb3255148','TEM常规护理','1e861a0042284dfeb7305fab5df879cc','2015-08-30 09:00',NULL,100,0,0,'TEN护理常规：\r\n\r\n1.妥善固定胃管或鼻肠管，防止滑脱移动，盘绕扭曲。\r\n\r\n2.每日输注前后，均以温开水冲洗管道，防止营养液残留堵塞管腔。\r\n\r\n3.保证营养液合适温度，一般保持在37℃。\r\n\r\n4.注意浓度、容量与速度。浓度应从低到高，容量由少到多，滴速逐渐加快，开始40-60ml/h，以后每12-24小时增加25ml，最大速度为100-125ml/h.\r\n\r\n5.体位要合适，经胃灌饲多采用半坐卧位，发现有胃潴留时应暂停灌注，防止反流入呼吸道引起肺部并发症。\r\n\r\n6.观察反应，如出现腹胀、腹痛、腹泻、恶心呕吐，应考虑是否供应量不适当，膳食温度、速度是否适宜，喂养管是否合适等。\r\n\r\n7.正确记录24h出入量，观察患者有无口渴、皮肤粘膜弹性以及尿量的变化。\r\n\r\n8.定期检查肝、肾功能及白蛋白的变化。准确留24h尿测定氨平衡以评价肠内营养效果，观察患者的血糖、血脂的变化。\r\n\r\n9.观察体温、呼吸、脉搏、血压的变化医|学教育网收集整理，了解有无肠道感染。',NULL,'2015-07-28 14:34:05',1,NULL,NULL,'zb_img_20150728023405421387.jpg',NULL,NULL,NULL),('b556fe6cfe064bcaa81c750841c9a0e5','gh_8e5eb3255148','危重病常见内环境紊乱','1b6763d8198e4f7ba87b5571005c3821','2015-09-5 09:00',NULL,100,11,5,'内环境稳定是所有危重病综合救治过程中不可忽视的重要环节，具体内容是水、电解质、酸碱平衡、血糖、渗透压等。严格意义上说，还包括内、外分泌的激素等。',NULL,'2015-07-29 14:52:20',1,NULL,NULL,'zb_img_2015072902522065712.jpg',NULL,NULL,NULL),('bc59e5bedae9469fa4d0e1f05034c8bb','gh_8e5eb3255148','ICU病人镇痛镇静指南','c1758ce5192a468fac250ce10107280e','2015-08-30 09:00',NULL,150,6,3,'重症医学的发生与发展旨在为多器官功能障碍的非终末期重症病人提供全面而有效的生命支持，以挽救病人的生命，并最大程度地恢复和保持病人的生活质量。\r\n镇痛与镇静治疗是特指应用药物手段以消除病人疼痛，减轻病人焦虑和躁动，催眠并诱导顺行性遗忘的治疗.',NULL,'2015-07-29 14:36:18',1,NULL,NULL,'zb_img_20150729023618985370.jpg',NULL,NULL,NULL),('e757c88adf7f43cabb5515f47d2696dd','gh_8e5eb3255148','ICU的康复治疗','e4149b6a62734b749582b37948a3af3b','2015-08-29 09:00~11:30',NULL,100,0,0,'康复治疗前应先对病、伤、残者进行康复评定，然后制定一个康复治疗方案，由以康复医师为中心的，康复治疗师和临床医学相关人员共同组成的康复治疗组去实施，并在实施过程中不断总结、评定、调整，直至治疗结束。',NULL,'2015-07-24 11:57:03',1,NULL,NULL,'zb_img_20150724115703780534.jpg',NULL,NULL,NULL);

