insert  into `course_db`(`id`,`public_no`,`title`,`expert_openid`,`profile`,`price`,`attachments2`,`attachments1`,`attachments_type`,`create_time`,`delete_state`,`create_user`,`zan_num`,`collect_num`,`filed1`,`filed2`,`filed3`,`filed4`,`filed5`) values ('085dcfd2f83d4b3691af42d61dae89be','gh_8e5eb3255148','','exper','',NULL,NULL,NULL,NULL,'2015-07-30 17:24:01',1,NULL,0,0,NULL,'db_img_2015073005240162578.jpg',NULL,NULL,NULL),('13f4aa06f18d4fadb22a04f9bebdefe2','gh_8e5eb3255148','','exper','',NULL,NULL,NULL,NULL,'2015-07-30 15:37:24',1,NULL,0,0,NULL,'db_img_20150730033724469183.jpg',NULL,NULL,NULL),('256e53a45f6c46249e4eb3e999fc3633','gh_8e5eb3255148','ICU常用药物','a7e0e71ca3d64af188482901d2ffd301','ICU常用药物',NULL,'1438130856928.pdf','1438130734478.mp4',NULL,'2015-07-28 15:51:50',1,NULL,0,2,NULL,'db_img_20150728035150813972.jpg',NULL,NULL,NULL),('36cc375a52c947f6bf75fd061103c80e','gh_8e5eb3255148','3小时bundle：我们做到了吗','e4149b6a62734b749582b37948a3af3b','优秀的临床指南可以规范诊疗和改善患者预后,指南有助于促进临床诊疗过程的规范化，但同时要强调治疗的个体化指南落实是指南的生命力,指南的依从性并不高，推广和普及所需时间较长,指南的推广应用面临着“知易行难”的困境 ,需要制定有效的治疗策略保证指南的落实.',NULL,'','yl.mp4',1,'2015-07-22 14:04:29',1,NULL,0,1,NULL,'db_img_20150722020429572694.jpg',NULL,NULL,NULL),('456e43760a9a44828161ae7faf64c5c3','gh_8e5eb3255148','','exper','',NULL,NULL,NULL,NULL,'2015-07-31 09:08:41',1,NULL,0,0,NULL,'db_img_20150731090841890564.jpg',NULL,NULL,NULL),('5630aac515be44d78c4b34a15daf90f7','gh_8e5eb3255148','ICU内值得重视的问题','fbc130ea108a441ca986ad79bbbf219a','入住ICU的部分老年患者，数天后会出现谵妄、幻觉、烦躁，有些患者在应用安定、咪唑安定、苯二氮卓类药物治疗后，症状不能缓解，谵妄、烦躁反而加剧。',NULL,'1438153349368.pdf','1438304701459.mp4',1,'2015-07-29 15:02:19',1,NULL,5,16,NULL,'db_img_20150729030219148573.jpg',NULL,NULL,NULL),('574f5c8f5b214768ab388a7c2c3fefc6','gh_8e5eb3255148','ICU深静脉置管','be393a42b2de4554b10387caadd2d0b6','经体表穿刺至相应的静脉，插入各种导管至大血管腔内或心腔。利用其测定各种生理学参数，同时也可为各种治疗提供直接便利路途。――仍是重症病房、大手术和救治危重病员不可缺少的手段',NULL,'1438148166026.mp4','1438148725948.mp4',1,'2015-07-29 11:12:19',1,NULL,0,0,NULL,'db_img_20150729111219873265.jpg',NULL,NULL,NULL),('5e7d95868774496a9e785269d392dfc5','gh_8e5eb3255148','<script>alert(--)</script>','exper','dd',NULL,NULL,NULL,NULL,'2015-07-30 17:23:52',1,NULL,0,0,NULL,'db_img_20150730052352184092.jpg',NULL,NULL,NULL),('7ec205638f054e8caf08fc136f3f7cf1','gh_8e5eb3255148','ICU内值得重视的问题','e4149b6a62734b749582b37948a3af3b','ICU内值得重视的问题',NULL,NULL,NULL,NULL,'2015-07-28 11:51:08',1,NULL,0,-1,NULL,'db_img_2015072811510823817.jpg',NULL,NULL,NULL),('83dc6e3b5e6644289f166ba108df1806','gh_8e5eb3255148','','exper','',NULL,NULL,NULL,NULL,'2015-07-30 15:37:19',1,NULL,0,0,NULL,'db_img_20150730033719278643.jpg',NULL,NULL,NULL),('91e46daddce949bebbd4712450b49b63','gh_8e5eb3255148','','exper','',NULL,NULL,NULL,NULL,'2015-07-30 14:37:58',1,NULL,0,0,NULL,'db_img_20150730023758805392.jpg',NULL,NULL,NULL),('a50dc17e05c64455bf3e54046457a2c1','gh_8e5eb3255148','什么是理想的营养治疗途径？','1e861a0042284dfeb7305fab5df879cc','肠内营养及肠外营养对预后的影响无显著差异，加强院感的防控、鼻饲操作的规范及血糖控制等措施可以减少PN的感染并发症，EN发生肠道反应及低血糖的几率要高于PN，加强评估与监测，合理选择喂养部位（胃或小肠），促动措施的使用以及适宜的营养制剂等多因素综合考虑，合理选择，将有助于提高肠内营养的效果。',NULL,'yl20150518.pdf','1438050459085.mp4',2,'2015-07-22 14:14:02',1,NULL,0,1,NULL,'db_img_20150722021402279651.jpg',NULL,NULL,NULL),('bb15869a94eb4c3686744f8d86e9a4dc','gh_8e5eb3255148','','exper','',NULL,NULL,NULL,NULL,'2015-07-31 09:26:18',1,NULL,0,0,NULL,'db_img_2015073109261845192.jpg',NULL,NULL,NULL),('bdb55e21b24849099e96c68ba6c80e2d','gh_8e5eb3255148','','exper','',NULL,NULL,NULL,NULL,'2015-07-30 15:37:15',1,NULL,0,0,NULL,'db_img_20150730033715345702.jpg',NULL,NULL,NULL),('d111c33652d54011bdc65f2cb4a3162a','gh_8e5eb3255148','1','exper','1',NULL,NULL,NULL,NULL,'2015-07-31 09:28:21',1,NULL,0,0,NULL,'db_img_20150731092821934802.jpg',NULL,NULL,NULL),('da30112172864d088bfd268951b8d179','gh_8e5eb3255148','发','exper','',NULL,NULL,NULL,NULL,'2015-07-31 09:28:12',1,NULL,0,0,NULL,'db_img_20150731092812572364.jpg',NULL,NULL,NULL),('ee2f6d659dc749cdb7d026ed5f382c2f','gh_8e5eb3255148','ICU深静脉置管','9e2c135ff95342b69885b140c1936afb','经体表穿刺至相应的静脉，插入各种导管至大血管腔内或心腔。利用其测定各种生理学参数，同时也可为各种治疗提供直接便利路途',NULL,'1438153303976.pdf',NULL,2,'2015-07-29 15:01:30',1,NULL,1,5,NULL,'db_img_20150729030130785036.jpg',NULL,NULL,NULL),('f1fe65d2779e488e83f7cc0192471226','gh_8e5eb3255148','ICU常用药物','4ee4e32b3d6b4eb699c5288c85e4e60c','在重症医学科ICU中，大多患者为重症患者，在用药时需更加谨慎。',NULL,'1438153227630.pdf',NULL,2,'2015-07-29 15:00:11',1,NULL,2,4,NULL,'db_img_20150729030011819673.jpg',NULL,NULL,NULL),('f70b727cf23e4d5b9113673f589aace6','gh_8e5eb3255148','','exper','',NULL,NULL,NULL,NULL,'2015-07-30 14:44:10',1,NULL,0,0,NULL,'db_img_20150730024410975823.jpg',NULL,NULL,NULL),('f95251c1e637425f874627f832dd8538','gh_8e5eb3255148','11','exper','1',NULL,NULL,NULL,NULL,'2015-07-31 09:23:40',1,NULL,0,0,NULL,'db_img_20150731092340136795.jpg',NULL,NULL,NULL);

