insert  into `expert`(`id`,`public_no`,`open_id`,`name`,`tel`,`birthday`,`email`,`sex`,`job_title`,`type`,`head_img`,`busy_status`,`doctor_certificate`,`speciality`,`summary`,`create_time`,`create_user`,`filed1`,`filed2`,`filed3`,`filed4`,`filed5`) values ('155e3d71814b4d33b7e2fd7919dccc5b','gh_8e5eb3255148','hzj_001','胡振杰教授',NULL,NULL,NULL,NULL,'主任医师 硕士生导师',NULL,'head_img_20150729020410249013.jpg',1,NULL,'擅长多脏器功能衰竭的抢救与治疗。主要研究：\r\n1.脓毒症的发病机制及救治；\r\n2.SIRS和MODS机制与处理；\r\n3.ARDS的救治进展； \r\n4.危重病胃肠道黏膜屏障保护与营养支持；\r\n5.亚低温治疗在重症颅脑损伤中的基础研究与临床应用。\r\n','现任河北医科大第四医院重症医学科主任，兼任中华医学会重症医学分会常务委员，中国医师协会重症医学医师分会常务委员，中国病理生理学会危重病医学专业委员会常务委员，河北省医学会重症医学分会主任委员，河北省生理科学会危重病医学专业委员会主任委员，河北省重症医学质量管理与控制中心主任。\r\n      现承担《高容量血液滤过在感染性休克中的应用研究》及《肺损伤机制及相关干预的影响》两项课题（省科技厅指令性项目）；获河北省科技进步三等奖两项。发表论文20余篇，其中一篇发表在欧洲《Intensive care medicine》杂志上。2010年荣获“河北省医药卫生系统先进工作者”称号。','2015-07-29 14:04:10',NULL,'科主任',7,'重症医学科',NULL,NULL),('1b6763d8198e4f7ba87b5571005c3821','gh_8e5eb3255148','sq_001','宋青教授',NULL,NULL,NULL,NULL,'主任医师 博士生导师',NULL,'head_img_20150729020154702345.jpg',1,NULL,'在急危重病救治、严重感染救治尤其是对劳力性热射病（严重中暑）、急性重症胰腺炎、产妇急危重症、战创伤性急性呼吸窘迫综合症、多器官功能不全等的综合性的救治。','         现任全军重症医学专业委员会主任委员；中华医学会重症分会常委；中国病理生理学会危重病专业委员会委员，中国医师协会重症医学分会委员，中华医学会急诊分会委员，中央保健局会诊专家等多项职务。担任《解放军进修学院学报》编委，《解放军医学杂志》编委，《中华老年多器官疾病杂志》编委，《中国呼吸与危重监护杂志》编委。\r\n         参与编写《新编麻醉学》、《呼吸危重病学》、《妇产科急症学》等。曾获军队医疗成果一等奖，获军队医疗成果三等奖。','2015-07-29 14:01:54',NULL,'------',6,'重症医学科',NULL,NULL),('2e66384eaabe490ebefe578878d1a395','gh_8e5eb3255148','lym_001','黎毅敏教授',NULL,NULL,NULL,NULL,'主任医师   博士生导师',NULL,'head_img_2015072902052094256.jpg',1,NULL,'长期从事危重症、呼吸系统疾病及重症感染患者的救治诊疗工作。主要研究领域：重症感染的诊疗、Sepsis、ARDS、人工通气及医院感染控制等。主持或参与国家自然科学基金项目、中外重大合作项目及省自然科学基金项目多项。参与了中华医学会重症医学分会多项诊疗指南的撰写。','现任呼吸疾病国家重点实验室副书记，广州医科大学附属第一医院副院长，重症医学科主任，广州呼吸疾病研究所副书记；兼任中华医学会重症医学分会常务委员，中华医学会呼吸病学分会重症学组副组长，中国医师协会重症分会及呼吸分会常委，广东省危重医学分会副主委。担任《中国实用内科学》、《国际呼吸杂志》的常务编委、《中华营养学杂志》编委等。','2015-07-29 14:05:20',NULL,'副院长/科主任',8,'重症医学科',NULL,NULL),('309482a275cd48e9b5c08866e37b5e25','gh_8e5eb3255148','wct_001','王春亭教授',NULL,NULL,NULL,NULL,'主任医师 博士生导师',NULL,'head_img_20150729015805924385.jpg',1,NULL,'擅长气道狭窄、困难撤机、多发性创伤、休克、重症感染、ARDS、多器官功能衰竭等危重病人的救治。','现任山东省立医院重症医学科主任，兼任中华医学会重症医学分会副主任委员，中国医师协会重症医学医师分会副会长，中国医师协会重症医学质量与安全控制委员会主任委员，中国病理生理学会危重病专业委员会常委，山东省医学会重症医学分会主任委员，山东省医师协会重症医学医师分会主任委员，山东省卫计委重症监护质量控制中心主任。担任中华急危重病杂志、中华急诊医学杂志、山东医药杂志编委。\r\n      主编/参编的专著：《现代重症抢救技术》《重症医学年鉴》《避免ICU常见错误》等； 发表重症论文50余篇、SCI相关论著7篇。曾获省科技进步二等奖、医药卫生科技进步三等奖。','2015-07-29 13:58:05',NULL,'科主任',4,'重症医学科',NULL,NULL),('3c27a073a37a46df9d61edf21d4a2523','gh_8e5eb3255148','ky_001','康焰教授',NULL,NULL,NULL,NULL,'主任医师 博士生导师',NULL,'head_img_2015072901593594528.jpg',1,NULL,'主要从事危重疾病临床、教学及科研工作。研究方向为重症患者脏器功能监测与支持。在MODS基础研究与临床诊治、重症感染、临床营养支持、镇痛-镇静治疗等方面有丰富的经验。 ','现任华西医院重症医学科主任。为四川省学术技术带头人，四川省有突出贡献优秀专家。兼任中华医学会重症医学分会常委、中国医师协会重症医学医师分会副会长、中国病理生理暨危重病医学会常委。四川省医学会重症医学专业委员会主任委员、四川省医师协会重症医师专科委员会主任委员、四川省重症医学质量控制中心主任。中华医学会重症医师资质培训委员会委员、资质培训班授课专家。《中华危重病急救医学》、《中国呼吸与危重监护杂志》及《美国感染性疾病学会杂志（中文版）》、《美国重症医学杂志（中文版）》编委。','2015-07-29 13:59:35',NULL,'科主任',5,'重症医学科',NULL,NULL),('4ee4e32b3d6b4eb699c5288c85e4e60c','gh_8e5eb3255148','yxy_001','于湘友教授',NULL,NULL,NULL,NULL,'主任医师 博士生导师',NULL,'head_img_20150729021920975820.jpg',1,NULL,'','现任新疆医科大一附院重症医学科主任，兼任中华医学会重症医学分会全国委员，中国病理生理学会危重病医学专业委员会全国委员，中国医师协会重症医学医师分会常委，中国医师协会神经外科医师分会第四届委员会神经重症专家委员会委员，新疆危重症学专业委员会主任委员，新疆重症医学质量控制中心主任。','2015-07-29 14:19:20',NULL,'科主任',12,'重症医学科',NULL,NULL),('6bbc50bd117947468d53a6e560221f7b','gh_8e5eb3255148','wx_001','王雪教授',NULL,NULL,NULL,NULL,'主任医师 硕士生导师',NULL,'head_img_20150729022109465708.jpg',1,NULL,'主要研究领域为MODS的临床救治，CRRT在重症医学中的应用，抗生素PK/PD的临床应用。','现任陕西省人民医院重症医学科主任，兼任中华医学会重症医学分会委员，中国病理生理学会危重病专业委员会委员，中国医师协会重症医学医师分会常委，中国医师协会重症医学医师分会安全与质量控制委员会委员，国家卫计委重症医学质控评价中心工作委员会委员，陕西省重症医学会主任委员，陕西省重症医学质量控制中心主任。 担任《中华医学杂志英（英文版）》审稿人，《药物不良反应杂志》编委，《中国感染控制杂志》编委。主编/参编：《重症医学年鉴》，《重症医学住院医师规范化培训》，《重症医学高级教程》，《呼吸机相关肺炎防治指南》，《多重耐药菌医院感染防控中国专家共识》，《重症血流动力学—北京共识》等十多部。发表论文50余篇，其中SCI收录4篇。','2015-07-29 14:21:09',NULL,'科主任',13,'重症医学科',NULL,NULL),('811944a0097744ef93cc1d003f97541a','gh_8e5eb3255148','yj_001','严静教授',NULL,NULL,NULL,NULL,'主任医师 博士生导师',NULL,'head_img_20150729015658167592.jpg',1,NULL,'在多种心血管疾病如冠心病、急性心肌梗塞、各种严重心律失常、心力衰竭及多脏器功能衰竭等方面具有丰富的诊治与抢救经验。\r\n       主要研究方向：心力衰竭的防治策略、休克与血流动力学监测及支持 ','现任浙江医院院长，党委副书记；兼任中华医学会重症医学分会常委，中国病理生理学会重症医学分会常委，卫生部ICU考试专家委员会副主任，华东地区急重症医学协作组副主任委员，浙江省医学会重症医学分会主任委员，浙江省ICU质控中心主任；为国家临床重点专科重症医学、省医学重点学科群老年医学和重点学科重症医学学学科带头人。负责制定国内《严重感染与感染性休克的血流动力学监测与支持指南》、《中国重症加强治疗病房(ICU)建设与管理指南》等多项指南。2011年享受政府特殊津贴，2012年获全国优秀医院院长荣誉称号。 \r\n       担任《中华老年病研究电子杂志》主编，《中华危重病急救医学》杂志编委、《中华急诊医学杂志》编委、《中华老年多器官疾病杂志》编委、《全科医学临床与教育杂志》编委等。','2015-07-29 13:56:58',NULL,'院长/党委副书记',3,'浙江医院',NULL,NULL),('8228cff1972a43a0a543d5419e78e9b5','gh_8e5eb3255148','gxd_001','管向东教授',NULL,NULL,NULL,NULL,'主任医师 博士生导师',NULL,'head_img_2015072901553174193.jpg',1,NULL,'擅长重症胰腺炎、休克、重症感染、ARDS、多器官功能衰竭等危重病人的救治。','现任中大一附院重症医学科主任，兼任中华医学会重症医学分候任主任委员，广东省卫计委ICU医疗质量控制中心主任，国家卫计委重症医学医疗质量控制中心副主任，广东省医学会重症医学专业委员会主任委员，中国医师协会重症医学分会常务委员，广东省医学会常务理事。担任《Critical Care Medicine》中文版、《Annals of Surgery》中文版、《中华危重病与急救医学杂志》等杂志的执行主编/编委。\r\n       主编/参编的专著包括《ICU建设管理指南》、《低血容量休克指南》、《重症医学年鉴》、《ICU主治医师手册》等数十本；发表重症专业相关论文80余篇、SCI相关论著8篇。曾获国家科技进步二等奖、广东省科技进步奖与广东省医药卫生科技进步二等奖。至2013年连续举办九届国家级继续教育项目“重症管理学习班”。','2015-07-29 13:55:31',NULL,'科主任',2,'重症医学科',NULL,NULL),('9e2c135ff95342b69885b140c1936afb','gh_8e5eb3255148','zfc_001','周发春教授',NULL,NULL,NULL,NULL,'主任医师   硕士生导师',NULL,'head_img_20150729021031791235.jpg',1,NULL,'重症胰腺炎、脓毒症、多发伤、严重中毒、多脏器功能不全等临床救治。','现任重庆医科大一附院重症医学科主任，急诊科主任，兼任中华医学会重症医学分会常委，中国医师协会重症医学分会常委，中国病理生理学会重症医学分会委员，中华医学会重症医学分会重症医学质量控制中心委员，中国医师协会重症医学分会重症医学质量控制中心委员，重庆市医学会重症医学专业委员会主任委员。担任《CCM中文版》杂志、《中华临床营养杂志》 、《中国急救医学》、 《重庆医学》、《重庆医科大学学报》等杂志编委。','2015-07-29 14:10:31',NULL,'科主任',9,'重症医学科',NULL,NULL),('c1758ce5192a468fac250ce10107280e','gh_8e5eb3255148','pjk_001','ProfJohn Kellum',NULL,NULL,NULL,NULL,'博士生导师',NULL,'head_img_20150729015057250839.jpg',1,NULL,'Kellum教授一直是UPMC的心胸ICU负责人，擅长心胸病人术后ICU管理、心肺移植病人的处理、脓毒症病人的治疗、血液净化及ECMO的应用。\r\n','        现任美国匹兹堡大学医学中心（UPMC）重症医学系副主席，重症肾脏病中心主任。1991年在Rochester 大学完成内科住院医师训练，1993年在匹兹堡大学完成重症专科医师训练。历任匹兹堡大学医学中心重症医学系助理教授、副教授及终身正教授。对脓毒症、急性肾损伤、血液净化颇有研究，曾获美国NIH课题经费近二千万美元，在新英格兰医学杂志、柳叶刀、JAMA等杂志上共发表文章300多篇，在欧洲、澳大利亚、泰国、中国近10所大学任客座教授或兼职教授。','2015-07-29 13:50:57',NULL,'副主席',1,'重症医学系',NULL,NULL),('e1672f3ba6b2408b8f407ae22b619e8e','gh_8e5eb3255148','qkj_001','钱克俭教授',NULL,NULL,NULL,NULL,'主任医师 博士生导师',NULL,'head_img_20150729021206761093.jpg',1,NULL,'','现任南昌大学第一附属医院重症医学科主任，兼任中华医学会重症医学分会委员，江西省医学会重症医学分会主任委员。\r\n     相继承担国家自然科学基金2项，江西省科技进步三等奖1项。','2015-07-29 14:12:06',NULL,'科主任',10,'重症医学科',NULL,NULL),('fbc130ea108a441ca986ad79bbbf219a','gh_8e5eb3255148','qby_001','秦秉玉教授',NULL,NULL,NULL,NULL,'主任医师  硕士生导师',NULL,'head_img_20150729021707357109.jpg',1,NULL,'','现任河南省重症医学分会主任委员，河南省人民医院重症医学部主任，中华医学会重症医学分会全国委员，中国医师协会重症医学医师分会全国委员，中国病理生理学会危重病医学分会全国委员，中国医师协会重症医学医师分会心脏重症专家委员会常委，河南省麻醉学会常委，河南省器官移植分会委员。','2015-07-29 14:17:07',NULL,'科主任',11,'重症医学部',NULL,NULL);

