/*Table structure for table `information` */

DROP TABLE IF EXISTS `information`;

CREATE TABLE `information` (
  `pkid` varchar(32) NOT NULL DEFAULT '',
  `brand_id` varchar(32) DEFAULT NULL,
  `information_title` varchar(100) DEFAULT NULL,
  `information_description` longtext,
  `information_image` varchar(100) DEFAULT NULL,
  `use_state` int(4) DEFAULT '1',
  `end_time` varchar(20) DEFAULT NULL,
  `start_time` varchar(20) DEFAULT NULL,
  `create_user` varchar(32) DEFAULT NULL COMMENT '用来存放消息的创建者 前台传值',
  `create_time` varchar(20) NOT NULL DEFAULT '',
  `type` int(4) DEFAULT '1' COMMENT '0:其他 1：会员新闻 3：会员资讯 4:会员消息 5：专家消息 6:专家新闻 7:专家资讯',
  `delete_state` int(4) DEFAULT '1',
  `field_1` varchar(32) DEFAULT NULL COMMENT '存放推送消息的ID',
  `field_2` longtext COMMENT '多图文消息的排序',
  `field_3` varchar(32) DEFAULT NULL COMMENT '是否显示封面',
  `field_4` varchar(500) DEFAULT NULL COMMENT '原文链接',
  `field_5` varchar(32) DEFAULT NULL,
  `media_id` varchar(64) DEFAULT NULL,
  PRIMARY KEY (`pkid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `information` */

insert  into `information`(`pkid`,`brand_id`,`information_title`,`information_description`,`information_image`,`use_state`,`end_time`,`start_time`,`create_user`,`create_time`,`type`,`delete_state`,`field_1`,`field_2`,`field_3`,`field_4`,`field_5`,`media_id`) values ('6fd03770d34544a48751287d4e954695','gh_8e5eb3255148','取消多数药品定价后不意味着可“任性”卖高价药','<p>&nbsp;&nbsp;&nbsp;&nbsp;本月起，我国取消除麻醉药品和第一类精神药品之外的绝大部分药品政府定价，一时间引发了社会各界热议，相关药品价格上涨的消息也屡见网络报端。19日，市物价局监督检查分局组织召开了我市药品市场价格行为政策提醒告诫会，包括桂林南药、桂林三金在内的7家药品生产企业、7家医药公司，各大医院、药品零售连锁企业以及市中心血站等26家单位企业参加了会议。</p><p>　　“只要关注各大新闻门户网站，就知道近期有一条‘爆炸新闻’：外地媒体报道，取消药品政府定价后，一种叫地高辛片的心脏病常见药品价格上涨了10倍。其实这里面的原因有很多，但老百姓对这样的新闻很敏感，容易产生负面的情绪，甚至产生恐慌……”市物价局监督检查分局相关负责人说，政策实施后，目前桂林药品价格市场也发生着一些变化，但依旧保持平稳，他们也还未收到消费者的相关投诉。</p><p>　　该负责人说，我国取消药品政府定价，交由市场决定，并不意味着“不管”，而是政府职能从事前定价向事中事后监管转变，工作重点从监管价格水平向监管价格行为转移。为此，，价格主管部门将研究制定药品价格行为规定，指导生产经营者遵循公平、合法、诚实信用的原则，合理制定价格，规范药品市场价格行为。</p><p>　　同时，还将加大价格监督检查和反垄断执法力度。该局目前正在对我市药品市场进行为期半年的专项检查，严厉打击互相串通操纵市场价格、滥用市场支配地位来高价销售药品等价格违法行为。</p><p>　　“如果相关单位企业出现了价格违法行为，我们将严肃处理，必要时还会联合相关部门对违法单位企业进行处罚。”市物价局监督检查分局相关负责人表示，无论是消费者还是经营者，遇到问题都可以拨打12358价格举报热线，物价部门会第一时间作出处理，充分发挥全国价格举报管理信息系统的作用。</p><p><br/></p>','material_20150728054130602851.jpg',1,NULL,NULL,'','2015-07-29 11:23:43',2,1,'580224d421414e4793727031fd38255e','0',NULL,NULL,NULL,NULL),('81a6541e1db649e28022cfa1c945f63a','gh_8e5eb3255148','取消多数药品定价后不意味着可“任性”卖高价药','<p>&nbsp;&nbsp;&nbsp;&nbsp;本月起，我国取消除麻醉药品和第一类精神药品之外的绝大部分药品政府定价，一时间引发了社会各界热议，相关药品价格上涨的消息也屡见网络报端。19日，市物价局监督检查分局组织召开了我市药品市场价格行为政策提醒告诫会，包括桂林南药、桂林三金在内的7家药品生产企业、7家医药公司，各大医院、药品零售连锁企业以及市中心血站等26家单位企业参加了会议。</p><p>　　“只要关注各大新闻门户网站，就知道近期有一条‘爆炸新闻’：外地媒体报道，取消药品政府定价后，一种叫地高辛片的心脏病常见药品价格上涨了10倍。其实这里面的原因有很多，但老百姓对这样的新闻很敏感，容易产生负面的情绪，甚至产生恐慌……”市物价局监督检查分局相关负责人说，政策实施后，目前桂林药品价格市场也发生着一些变化，但依旧保持平稳，他们也还未收到消费者的相关投诉。</p><p>　　该负责人说，我国取消药品政府定价，交由市场决定，并不意味着“不管”，而是政府职能从事前定价向事中事后监管转变，工作重点从监管价格水平向监管价格行为转移。为此，，价格主管部门将研究制定药品价格行为规定，指导生产经营者遵循公平、合法、诚实信用的原则，合理制定价格，规范药品市场价格行为。</p><p>　　同时，还将加大价格监督检查和反垄断执法力度。该局目前正在对我市药品市场进行为期半年的专项检查，严厉打击互相串通操纵市场价格、滥用市场支配地位来高价销售药品等价格违法行为。</p><p>　　“如果相关单位企业出现了价格违法行为，我们将严肃处理，必要时还会联合相关部门对违法单位企业进行处罚。”市物价局监督检查分局相关负责人表示，无论是消费者还是经营者，遇到问题都可以拨打12358价格举报热线，物价部门会第一时间作出处理，充分发挥全国价格举报管理信息系统的作用。</p><p><br/></p>','material_20150728054130602851.jpg',1,NULL,NULL,'','2015-07-29 09:29:54',1,1,'580224d421414e4793727031fd38255e','0',NULL,NULL,NULL,NULL),('82e559ce6120470ca344557f4ffa12b0','gh_8e5eb3255148','移动医疗切入慢性病细分市场 信息准确性亟待提升','<p>&nbsp;&nbsp;&nbsp;&nbsp;随着生活节奏的加快，亚健康人群在增多，大家对慢性病的重视程度也与日俱增，这也成为移动医疗领域的新风口。据《科技日报》报道，作为我国首个慢病领域的移动医疗随诊随访平台，易随诊将为全国数千万肿瘤和慢性病患者提供专业的随诊随访医疗服务。鱼跃医疗子公司医云健康近日在北京举行了大医生APP的产品发布会，开启慢性病管理的新征程。移动医疗APP“掌控肝病”上线，，主打慢性病管理……</p><p>　　在我国医疗APP这片红海中，若想占有一席之地，朝着单领域平台的方向发展，并具有一定的针对性，或许是不错的路子。当然，提升用户粘性的关键是保证信息的准确性。</p><p>　　慢性病人群是移动医疗的新蓝海</p><p>　　随着我国“互联网+”的提出，医疗行业融入互联网的步伐在加快，特别是医疗APP近年发展迅猛。据相关数据显示：截至2013年，我国移动医疗市场规模约为22亿多元，预计2017年达到125亿元左右规模。</p><p>　　目前，仅移动医疗APP就多达2000多款，互联网巨头BAT更是移动医疗行业的强劲参与者。百度开设了健康、医生、dulife三个自主板块，分别对应医院、医生和硬件。腾讯领投豪斥1.5亿元开始深度布局移动医疗服务领域，投资了丁香园、挂号网、邻家医生等。阿里方面，在其收购了中信21世纪后更名为阿里健康，目前几乎现阶段互联网医疗覆盖可能涉及的全部阶段，还投资了华康全景网等公司。尽管移动医疗APP种类繁多，但是，同质化现象明显，多数成为了网上预约的工具和充当了类似“百度知道”、“搜搜问问”的医学类解答平台。</p><p>　　另据医疗统计数据显示，全国知名、受患者追捧的医生不超10万人。全国每年门诊挂号量78亿人次，目前预约比例在5%左右，也就是约4亿人次实现预约。那么剩下的人群呢？</p><p>　　在门诊预约如此困难的大环境下，慢性病患者及时进行预约问诊显得格外困难。然而，慢性病却已成为当今社会的头号杀手。根据卫生部的调查报告，我国慢性病发病人数快速上升，现有确诊患者 2.6 亿人，目前中国慢性病患者(心血管疾病、癌症、糖尿病和慢性肺疾病等)每年以 8.9%的速度递增。</p><p>　　因此，专项针对慢性病人群的移动医疗平台的出现，刚好填补了门诊挂号困难的空缺，让患者通过互联网进行定期自查和远程诊疗达到门诊一样的治疗效果。这是一个新的刚需市场，更是在移动医疗这片红海中发掘的一片新蓝海。</p><p><br/></p>','material_20150728054048687409.jpg',1,NULL,NULL,'','2015-07-29 09:30:10',1,1,'238a08027014409ea20ac1530651744e','0',NULL,NULL,NULL,NULL),('b85401bcde534a099e203bc654753c7c','gh_8e5eb3255148','春节选购保健品指南','<p>&nbsp;&nbsp;&nbsp;&nbsp;春节期间保健品市场格外红火，很多人走亲访友都会带上一份。不过，问题来了，保健品真的是越贵越好吗？如何挑选一份真正适用的保健品？</p><p>&nbsp; 一是认准“小蓝帽”。正规的保健食品的外包装上，会印制有一个“小蓝帽”形状的标志，并标注有“卫食健字”或“国食健字”的批准文号。有了这个标志，就说明国家药监部门对这个保健食品的成分、生产工艺、厂家资质都进行了严格的审核和认证，，产品的质量有保证。但是，近年来有不法商贩盗用健字号，因此消费者购买时要认准品牌，或者在国家食药监总局官网上查询产品名称或健字号。</p><p>　　二是别太信广告。药监专业人士提醒，保健食品广告与药品广告一样，不允许宣称效果立竿见影、患者现身说法、专家出面认可等，但目前很多保健品广告都违规宣传，夸大效果。事实上，保健品不是药品，仅有辅助治疗的功能，不可能疗效显著。消费者购买时应该理智选择，不要盲目听信广告。</p><p>　　三是注意禁忌症。药学专家提醒，保健品也有其适用范围，不是所有人都适合，特别是青少年、孕妇等，服用保健品或营养品要格外留心。而一些本身就身患疾病、正在服用药品的人士，更要注意是否与所服用的药品冲突，是否会对自身病情造成不良影响。</p><p>　　四是认准正规购买渠道。目前保健品不仅在实体店销售，网上销售、电话销售和电视购物都很火爆，很多未经国家食药监局认证的保健品也由此流入市场，特别是网上代购的进口产品，很多功效成分不明。药监人员提醒消费者，购买保健品要通过正规渠道，并且保留好消费凭证，一旦发现有问题可及时拨打食药监部门投诉举报电话12331。</p><p><br/></p>','material_20150728054107782530.jpg',1,NULL,NULL,'','2015-07-29 09:30:04',1,1,'92ee51d08d644a238b0029d30d40a73e','0',NULL,NULL,NULL,NULL);

/*Table structure for table `information_log` */

DROP TABLE IF EXISTS `information_log`;

CREATE TABLE `information_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `pkid` varchar(32) DEFAULT '',
  `brand_id` varchar(32) DEFAULT NULL,
  `information_title` varchar(100) DEFAULT NULL,
  `information_description` text,
  `information_image` varchar(100) DEFAULT NULL,
  `use_state` int(4) DEFAULT '1',
  `create_user` varchar(32) DEFAULT NULL,
  `create_time` varchar(20) DEFAULT '',
  `type` int(4) DEFAULT NULL COMMENT '分区群发和客服',
  `send_state` varchar(32) DEFAULT NULL,
  `delete_state` int(11) DEFAULT '1',
  `error_num` int(11) DEFAULT NULL,
  `success_num` int(4) DEFAULT NULL,
  `group_name` varchar(20) DEFAULT NULL,
  `msg_id` bigint(10) DEFAULT NULL COMMENT '消息ID',
  `status` varchar(20) DEFAULT NULL COMMENT '群发的结构，为“send success”或“send fail”或“err(num)”。',
  `total_count` bigint(10) DEFAULT '0' COMMENT 'group_id下粉丝数；或者openid_list中的粉丝数',
  `filter_count` bigint(10) DEFAULT '0' COMMENT '过滤（过滤是指特定地区、性别的过滤、用户设置拒收的过滤，用户接收已超4条的过滤）后，准备发送的粉丝数，原则上，FilterCount = SentCount + ErrorCount',
  `sent_count` bigint(10) DEFAULT '0' COMMENT '发送成功的粉丝数',
  `error_count` bigint(10) DEFAULT '0' COMMENT '发送失败的粉丝数',
  `field_1` varchar(32) DEFAULT NULL,
  `field_2` varchar(32) DEFAULT NULL,
  `field_3` varchar(32) DEFAULT NULL,
  `field_4` varchar(32) DEFAULT NULL,
  `field_5` varchar(32) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=67 DEFAULT CHARSET=utf8;

/*Data for the table `information_log` */

/*Table structure for table `log_course_collect` */

