/*Data for the table `material` */

insert  into `material`(`pkid`,`brand_id`,`author`,`title`,`image_url`,`content_source_url`,`contents`,`digest`,`show_cover_pic`,`create_time`,`parent_id`,`field1`,`field2`,`field3`,`field4`,`field5`,`field6`) values ('03385961aa224384a7c8f992c1bacbb2','gh_8e5eb3255148','','标题1','material_20150729033940348976.jpg','','<p>标题1</p>','','0','2015-07-29 15:39:57','','0','','','','',''),('106fc502bd374f648f5ef394f41bcbc4','gh_8e5eb3255148','','测试标题3','material_20150706021141397651.jpg','','<p>123123123123123</p>','','0','2015-07-06 14:11:49','cc43daf641fc4eb5ae6070aa69b564bd','1','','','','',''),('1cdeaf7520014c7fb38db88181069ff3','gh_8e5eb3255148','','标题2','material_2015060909341171268.jpg','','<p>2222</p>','','0','2015-06-09 21:34:17','600018604fb9470fbaed82da46aca62c','1','','','','',''),('238a08027014409ea20ac1530651744e','gh_8e5eb3255148','','移动医疗切入慢性病细分市场 信息准确性亟待提升','material_20150728054048687409.jpg','','<p>&nbsp;&nbsp;&nbsp;&nbsp;随着生活节奏的加快，亚健康人群在增多，大家对慢性病的重视程度也与日俱增，这也成为移动医疗领域的新风口。据《科技日报》报道，作为我国首个慢病领域的移动医疗随诊随访平台，易随诊将为全国数千万肿瘤和慢性病患者提供专业的随诊随访医疗服务。鱼跃医疗子公司医云健康近日在北京举行了大医生APP的产品发布会，开启慢性病管理的新征程。移动医疗APP“掌控肝病”上线，，主打慢性病管理……</p><p>　　在我国医疗APP这片红海中，若想占有一席之地，朝着单领域平台的方向发展，并具有一定的针对性，或许是不错的路子。当然，提升用户粘性的关键是保证信息的准确性。</p><p>　　慢性病人群是移动医疗的新蓝海</p><p>　　随着我国“互联网+”的提出，医疗行业融入互联网的步伐在加快，特别是医疗APP近年发展迅猛。据相关数据显示：截至2013年，我国移动医疗市场规模约为22亿多元，预计2017年达到125亿元左右规模。</p><p>　　目前，仅移动医疗APP就多达2000多款，互联网巨头BAT更是移动医疗行业的强劲参与者。百度开设了健康、医生、dulife三个自主板块，分别对应医院、医生和硬件。腾讯领投豪斥1.5亿元开始深度布局移动医疗服务领域，投资了丁香园、挂号网、邻家医生等。阿里方面，在其收购了中信21世纪后更名为阿里健康，目前几乎现阶段互联网医疗覆盖可能涉及的全部阶段，还投资了华康全景网等公司。尽管移动医疗APP种类繁多，但是，同质化现象明显，多数成为了网上预约的工具和充当了类似“百度知道”、“搜搜问问”的医学类解答平台。</p><p>　　另据医疗统计数据显示，全国知名、受患者追捧的医生不超10万人。全国每年门诊挂号量78亿人次，目前预约比例在5%左右，也就是约4亿人次实现预约。那么剩下的人群呢？</p><p>　　在门诊预约如此困难的大环境下，慢性病患者及时进行预约问诊显得格外困难。然而，慢性病却已成为当今社会的头号杀手。根据卫生部的调查报告，我国慢性病发病人数快速上升，现有确诊患者 2.6 亿人，目前中国慢性病患者(心血管疾病、癌症、糖尿病和慢性肺疾病等)每年以 8.9%的速度递增。</p><p>　　因此，专项针对慢性病人群的移动医疗平台的出现，刚好填补了门诊挂号困难的空缺，让患者通过互联网进行定期自查和远程诊疗达到门诊一样的治疗效果。这是一个新的刚需市场，更是在移动医疗这片红海中发掘的一片新蓝海。</p><p><br/></p>','','0','2015-07-28 17:40:50','','','','','','',''),('26680ea2d4974dbe9de18066ecf6b36f','gh_8e5eb3255148','','标题2','material_20150630044023245901.jpg','','<p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;\">作者：三喵（原创）</p><fieldset class=\"tn-Powered-by-XIUMI\" style=\"margin: 0px; padding: 0px; max-width: 100%; min-width: 0px; box-sizing: border-box !important; word-wrap: break-word !important;\"><section class=\"tn-Powered-by-XIUMI\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; height: 1em; word-wrap: break-word !important;\"><section class=\"tn-Powered-by-XIUMI\" style=\"margin: 0px; padding: 0px; max-width: 100%; height: 16px; width: 1.5em; float: left; border-top-width: 0.4em; border-top-style: solid; border-color: rgb(0, 112, 192); border-left-width: 0.4em; border-left-style: solid; box-sizing: border-box !important; word-wrap: break-word !important;\"></section><section class=\"tn-Powered-by-XIUMI\" style=\"margin: 0px; padding: 0px; max-width: 100%; height: 16px; width: 1.5em; float: right; border-top-width: 0.4em; border-top-style: solid; border-color: rgb(0, 112, 192); border-right-width: 0.4em; border-right-style: solid; box-sizing: border-box !important; word-wrap: break-word !important;\"></section><section class=\"tn-Powered-by-XIUMI\" style=\"margin: 0px; padding: 0px; max-width: 100%; display: inline-block; color: transparent; clear: both; box-sizing: border-box !important; word-wrap: break-word !important;\"></section></section><section class=\"tn-Powered-by-XIUMI\" style=\"margin: -0.8em 0.1em -1.2em 0.2em; padding: 1.12em 0.4em 1.12em 0.8em; max-width: 100%; box-sizing: border-box; border: 1px solid rgb(0, 112, 192); border-radius: 0.3em; word-wrap: break-word !important;\"><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: break-word; clear: both; min-height: 1