ox-sizing: border-box !important; background-image: none;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">努力做好自己的本分，</strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; word-wrap: break-word; clear: both; min-height: 1em; white-space: pre-wrap; border: none; color: rgb(51, 51, 51); font-size: 1em; word-break: break-all; text-align: center; font-family: 微软雅黑; font-weight: inherit; text-decoration: inherit; line-height: 1.5em; box-sizing: border-box !important; background-image: none;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">一切自有定论！</strong></p></section><section class=\"tn-Powered-by-XIUMI\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; line-height: 25.6000003814697px; white-space: normal; height: 1em; word-wrap: break-word !important; background-color: rgb(255, 255, 255);\"></section></fieldset><p><br/></p>','','0','2015-06-30 16:40:46','ea2e5a63d3b84ee0bd3b76f5ddade23c','1','','','','',''),('580224d421414e4793727031fd38255e','gh_8e5eb3255148','','取消多数药品定价后不意味着可“任性”卖高价药','material_20150728054130602851.jpg','','<p>&nbsp;&nbsp;&nbsp;&nbsp;本月起，我国取消除麻醉药品和第一类精神药品之外的绝大部分药品政府定价，一时间引发了社会各界热议，相关药品价格上涨的消息也屡见网络报端。19日，市物价局监督检查分局组织召开了我市药品市场价格行为政策提醒告诫会，包括桂林南药、桂林三金在内的7家药品生产企业、7家医药公司，各大医院、药品零售连锁企业以及市中心血站等26家单位企业参加了会议。</p><p>　　“只要关注各大新闻门户网站，就知道近期有一条‘爆炸新闻’：外地媒体报道，取消药品政府定价后，一种叫地高辛片的心脏病常见药品价格上涨了10倍。其实这里面的原因有很多，但老百姓对这样的新闻很敏感，容易产生负面的情绪，甚至产生恐慌……”市物价局监督检查分局相关负责人说，政策实施后，目前桂林药品价格市场也发生着一些变化，但依旧保持平稳，他们也还未收到消费者的相关投诉。</p><p>　　该负责人说，我国取消药品政府定价，交由市场决定，并不意味着“不管”，而是政府职能从事前定价向事中事后监管转变，工作重点从监管价格水平向监管价格行为转移。为此，，价格主管部门将研究制定药品价格行为规定，指导生产经营者遵循公平、合法、诚实信用的原则，合理制定价格，规范药品市场价格行为。</p><p>　　同时，还将加大价格监督检查和反垄断执法力度。该局目前正在对我市药品市场进行为期半年的专项检查，严厉打击互相串通操纵市场价格、滥用市场支配地位来高价销售药品等价格违法行为。</p><p>　　“如果相关单位企业出现了价格违法行为，我们将严肃处理，必要时还会联合相关部门对违法单位企业进行处罚。”市物价局监督检查分局相关负责人表示，无论是消费者还是经营者，遇到问题都可以拨打12358价格举报热线，物价部门会第一时间作出处理，充分发挥全国价格举报管理信息系统的作用。</p><p><br/></p>','','0','2015-07-28 17:41:31','','','','','','',''),('58fe3fa06c3748e7954cd3178c2cd3aa','gh_8e5eb3255148','','多图文信息222222222','material_20150724040051210374.jpg','','<p>多图文信息222222222</p>','','0','2015-07-24 16:00:55','eed0834221a149538928518dd9a574d0','1','','','','',''),('91313f843e954e49959487259ab7b8c4','gh_8e5eb3255148','','标题ashe测试不要删2','material_20150727100217810375.jpg','','<p>ashe测试不要删ashe测试不要删ashe测试不要删</p>','','0','2015-07-27 10:02:36','e18afee3eac0426c958ed68173996638','1','','','','',''),('92ee51d08d644a238b0029d30d40a73e','gh_8e5eb3255148','','春节选购保健品指南','material_20150728054107782530.jpg','','<p>&nbsp;&nbsp;&nbsp;&nbsp;春节期间保健品市场格外红火，很多人走亲访友都会带上一份。不过，问题来了，保健品真的是越贵越好吗？如何挑选一份真正适用的保健品？</p><p>&nbsp; 一是认准“小蓝帽”。正规的保健食品的外包装上，会印制有一个“小蓝帽”形状的标志，并标注有“卫食健字”或“国食健字”的批准文号。有了这个标志，就说明国家药监部门对这个保健食品的成分、生产工艺、厂家资质都进行了严格的审核和认证，，产品的质量有保证。但是，近年来有不法商贩盗用健字号，因此消费者购买时要认准品牌，或者在国家食药监总局官网上查询产品名称或健字号。</p><p>　　二是别太信广告。药监专业人士提醒，保健食品广告与药品广告一样，不允许宣称效果立竿见影、患者现身说法、专家出面认可等，但目前很多保健品广告都违规宣传，夸大效果。事实上，保健品不是药品，仅有辅助治疗的功能，不可能疗效显著。消费者购买时应该理智选择，不要盲目听信广告。</p><p>　　三是注意禁忌症。药学专家提醒，保健品也有其适用范围，不是所有人都适合，特别是青少年、孕妇等，服用保健品或营养品要格外留心。而一些本身就身患疾病、正在服用药品的人士，更要注意是否与所服用的药品冲突，是否会对自身病情造成不良影响。</p><p>　　四是认准正规购买渠道。目前保健品不仅在实体店销售，网上销售、电话销售和电视购物都很火爆，很多未经国家食药监局认证的保健品也由此流入市场，特别是网上代购的进口产品，很多功效成分不明。药监人员提醒消费者，购买保健品要通过正规渠道，并且保留好消费凭证，一旦发现有问题可及时拨打食药监部门投诉举报电话12331。</p><p><br/></p>','','0','2015-07-28 17:41:08','','','','','','',''),('965e11b166074e3ba9385846835690f3','gh_8e5eb3255148','','标题2','material_20150729033952170268.jpg','','<p>标题2</p>','','0','2015-07-29 15:39:57','03385961aa224384a7c8f992c1bacbb2','1','','','','',''),('a5a24de49f394c70a2080a9035a5c0d0','gh_8e5eb3255148','','234','material_20150706022327154376.jpg','','<p>1234而非为各国</p>','','0','2015-07-06 14:23:43','ff7ef5089bb7473f9bdb297360f38128','1','','','','',''),('abb3e509507c4c36b6fa764ffddd4583','gh_8e5eb3255148','','这是三号','material_20150706021755367824.jpg','','<p>这是三号的正文</p>','','0','2015-07-06 14:18:01','6f1b68cc2b7245369d6f123f7f0193d7','1','','','','','');

