/*Table structure for table `platform` */

DROP TABLE IF EXISTS `platform`;

CREATE TABLE `platform` (
  `id` varchar(32) NOT NULL DEFAULT '',
  `platformuser` varchar(20) DEFAULT NULL COMMENT '创建人',
  `platformtime` varchar(20) DEFAULT NULL COMMENT '创建时间',
  `platformstate` varchar(20) DEFAULT NULL COMMENT '状态',
  `platform` text COMMENT '平台简介',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `platform` */

insert  into `platform`(`id`,`platformuser`,`platformtime`,`platformstate`,`platform`) values ('dcfa9eff5dab4f32b34dca4b12adea5c','艾希','2015-07-31 14:24:53',NULL,'      上海复大医院，始建于1986年，坐落于上海市虹口区场中路628号-658号。医院开设有十二个专病诊疗科室，面神经诊疗中心作为医院科室。先后投巨资引进大批国内外高、精、尖的专科设备，自主研发\"面神经三联康复疗法\"成功为众多位患者康复疾病。\r\n    上海复大医院全体医务人员始终秉承\"救死扶伤，医者仁心\"的医德理念，积极为广大患者解除病痛。时至今日，医院连续三年被评为\" 百姓放心面神经医院 \"，并获得\"百姓公认诚信示范医院\"、\"中国治疗面神经疾病基地\"、\"面神经诊疗专区认定面神经疾病诊疗单位\"、\"面神经疾病技术推广单位\"等荣誉称号。');

